function processSelectedFile(e, t) {
    $("#" + t).val(e)
}
$(document).on("click", ".popup_selector", function (e) {
    e.preventDefault();
    $('body').elfinder({
        lang: 'ru',             // language (OPTIONAL)
        url: '/elfinder/connector'  // connector URL (REQUIRED)
    }).elfinder('instance');
})
